import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import { AppContainer } from "./App";
import { Provider } from "react-redux";
import memStore from "./redux/store";

ReactDOM.render(

    <React.StrictMode>
      <Provider store={memStore()}>
      <AppContainer />
    </Provider>
    </React.StrictMode>,
  document.getElementById("root")
);
